// Solution 1:
class Solution {
    public String[] shuffle(String[] nums, int n) {
        if (nums == null || nums.length < 2 || n <= 0) return nums;

        for (int i = 0; i < n; ++i) {
            // swap the elements at index i and n + i
            String temp = nums[n + i];
            nums[n + i] = nums[i];
            nums[i] = temp;
        }

        return nums;
    }
}

// Solution 2:
class Solution {
    public String[] shuffle(String[] nums, int n) {
        if (nums == null || nums.length < 2 || n <= 0) return nums;

        String[] result = new String[nums.length];
        for (int i = 0; i < n; ++i) {
            result[2 * i] = nums[i];
            result[2 * i + 1] = nums[n + i];
        }

        return result;
    }
}
